import { createStore } from 'vuex'

export default createStore({
  state: {
    fingerprint: null,
    fingerprintInt: null,

    colors: null
  },
  mutations: {
    setFingerprint(state, string) {
      state.fingerprint = string
    },
    setFingerprintInt(state, array) {
      state.fingerprintInt = array
    },
    setColor(state, array) {
      state.colors = array
    }
  },
  actions: {
  },
  modules: {
  }
})
